import React, { Component } from 'react'

export default class UserInfo extends Component {
  render() {
    const {
      name,
      email,
      handleChange,
      incrementPage,
      decrementPage
    } = this.props
    const moveNext = name && email && (
      <button onClick={incrementPage}>Next</button>
    )
    return (
      <div className="info">
        <h1>Sign Up</h1>
        <form>
          <input
            type="text"
            name="name"
            placeholder="Your Name"
            value={name}
            onChange={handleChange}
          />
          <br></br>
          <br></br>
          <input
            type="text"
            name="email"
            placeholder="Your Email"
            value={email}
            onChange={handleChange}
          />
        </form>
        <br></br>
        <div>
          <button onClick={decrementPage}>Back</button>
          {moveNext}
        </div>
      </div>
    )
  }
}
